End of form comments gives those supplying information the opportunity to comment on:
* any reporting problems or information unrelated to specific data that they have supplied on the form;
* any data that they have supplied on the form (for example, comments related to unusual movements or other factors);
* any questions which caused problems; and
* any suggested improvements to the form.
